import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";

const logo = styled("img")(({ theme }) => ({
  fontFfamily: "Times",
  fontSize: "36px",
  fontWeight: 400,
  lineHeight: "36px",
  letterSpacing: "0em",
  textAlign: "left",

  [theme.breakpoints.down("sm")]: {},
}));

function Home() {
  return (
    <>
      <Box
        sx={{
          height: "799px",
          maxWidth: "100%",
          backgroundColor: "#000000",
        }}
      >
        <Container></Container>
      </Box>
    </>
  );
}

export default Home;
